# process-mrva-results 0.0.1
extensions:
- addsTo:
    extensible: typeModel
    pack: codeql/python-all
  data:
  - - django.http.response.HttpResponseBadRequest~Subclass
    - s3direct
    - Member[views].Member[HttpResponseBadRequest]
  - - django.http.response.HttpResponseForbidden~Subclass
    - s3direct
    - Member[views].Member[HttpResponseForbidden]
  - - django.http.response.HttpResponseNotFound~Subclass
    - s3direct
    - Member[views].Member[HttpResponseNotFound]
  - - django.http.response.HttpResponseServerError~Subclass
    - s3direct
    - Member[views].Member[HttpResponseServerError]
  - - django.http.response.HttpResponse~Subclass
    - s3direct
    - Member[views].Member[HttpResponse]
